import React, { Component } from "react";

class Car extends Component {
  constructor(props) {
    super(props);
    this.bike = { brand: "BMW" };
    this.state = {
      brand: "Ford",
      model: "Mustang",
      color: "red",
      year: 1964,
    };
  }
  changeColor = () => {
    this.setState({ color: "blue" });
  };

  render() {
    return (
      <>
        <h1>This is car page</h1>
        <h2>The Bike brand is {this.bike.brand}</h2>
        <h2>
          My fav bike is {this.props.brand} {this.props.name}
        </h2>
        <div>
          <h1>My {this.state.brand}</h1>
          <p>
            It is a {this.state.color} {this.state.model} from {this.state.year}
            .
          </p>
          <button type="button" onClick={this.changeColor}>
            Change color
          </button>
        </div>
      </>
    );
  }
}

export default Car;
